import React, { Component } from 'react';
import LogoPC from './images/LogoPC.svg';

class Landing extends Component {
  render() {
    return(
      <div style={{paddingTop:'10%', paddingLeft: '10%', paddingRight: '10%'}}>
      <img className="LogoPCMain" src={LogoPC} style={{height: '20em'}}/>
      <h1 className="Tittle">UX / UI Designer</h1>
      <p className="SubTittle">"Design it till you make it"</p>
        <div style={{textAlign: 'center'}}>
          <p href="url" style={{display: 'inline'}}> <a className="LinkStyle" href="mailto:pablocg1995@gmail.com">
              <i class="fa fa-envelope fa-lg" style={{color: '#8b8b8b', fontSize:'3em', padding: '0.5em'}}></i></a></p>
          <p style={{display: 'inline'}}><a className="LinkStyle" href="tel:+34676328005">
              <i class="fa fa-phone fa-lg" style={{color: '#8b8b8b', fontSize:'3em', padding: '0.5em'}}></i></a></p>
          <p style={{display: 'inline'}}><a className="LinkStyle" href="https://www.linkedin.com/in/p-canton/">
              <i class="fa fa-linkedin fa-lg" style={{color: '#8b8b8b', fontSize:'3em', padding: '0.5em'}}></i></a></p>
          <p style={{display: 'inline'}}><a className="LinkStyle" href="https://www.linkedin.com/in/p-canton/?locale=en_US">
              <i class="fa fa-github fa-lg" style={{color: '#8b8b8b', fontSize:'3em', padding: '0.5em'}}></i></a></p>
        </div>
      </div>
    )
  }
}

export default Landing;
